import React from 'react';
import ReactDOM from 'react-dom';
import './footer.css';
import facebookImg from '../../../img/icons8-facebook-f-50.png'
import instaImg from '../../../img/icons8-instagram-50.png'
import whatsappImg from '../../../img/icons8-whatsapp-50.png'
import twitterImg from '../../../img/icons8-twitter-50.png'


class SocialMedia extends React.Component {
  render() {
    return (
      <div id="FOOTER" className="footer1 media container-fluid pt-4">
          <ul id="mediaBar" className="nav justify-content-left  ">
            <li id="facebook" className="nav-item media">
              <a className="nav-link" href="#"><img src={facebookImg}/></a>
            </li>
            <li id="insta" className="nav-item media">
              <a class="nav-link" href="#"><img src={instaImg}/></a>
            </li>
            <li id="whats" className="nav-item media">
              <a className="nav-link" href="#"><img className="img-fluid" src={whatsappImg}/></a>
            </li>
            <li id="mail" className="nav-item media">
              <a className="nav-link" href="#"><img className="img-fluid" src={twitterImg}/></a>
            </li>
          </ul>
      </div>
    );
  }
}

export default SocialMedia;
